import React from "react";
import {Input } from 'antd';
const Index = () => {
  return (
    <React.Fragment>
      <div className="home__wrapper">
        <div className="home__hero-container">
          <h1>Find a Recipe</h1>
          
          <Input className="home__search-input"/>
        </div>
      </div>
    </React.Fragment>
  );
};

export default Index;
